using namespace std;

void merge(int a[], int l, int m, int r){
	int n1 = l;
	int n2 = m+1;
	int arr[r - l + 1];
	int i = 0;
	while (i < r - l + 1){
		if (n1 <= m && n2 <= r){
			if (a[n1] < a[n2]){
				arr[i] = a[n1];
				n1++;
			}
			else {
				arr[i] = a[n2];
				n2++;
			}
		}
		else if (n1 <= m){
			arr[i] = a[n1];
			n1++;
		}
		else if (n2 <= r){
			arr[i] = a[n2];
			n2++;
		}
		// else break;
		i++;
	}
	for (int i = 0; i < r - l + 1; i++){
		a[l+i] = arr[i];
	}
}

void merge_sort(int a[], int l, int r){
	if (l >= r) return;

	int m = (l+r)/2;
	merge_sort(a, l, m);
	merge_sort(a, m+1, r);
	merge(a, l, m, r);
}

